A','N/A',NULL),(4477,1073,1005,1,'N/A','N/A',NULL),(4478,1074,1005,1,'N/A','N/A',NULL),(4479,1076,1005,1,'N/A','N/A',NULL),(4480,1077,1005,1,'N/A','N/A',NULL),(4481,1120,1005,1,'N/A','N/A',NULL),(4482,1120,1005,2,'N/A','N/A',NULL),(4483,1123,1005,1,'N/A','N/A',NULL),(4484,1179,1005,1,'N/A','N/A',NULL),(4485,1182,1012,1,'1	Set up the function generator output according to the wand, mode, and level being tested. The output of the function generator should be verified using an Oscilloscope connected to the IRMS 2 test point. If required, the setting on the function generator can be adjusted so that the measured values on the oscilloscope match the required input waveforms found in the specifications document.  The Specifications for RF 20000A Pump Speed Control (PSC) Algorithm (P/N 52272) contain the specific waveforms in the excel documents found in the CTOs office. Each wand, Flow 50 and Flow 90 has its own workbook and the input wave forms can be found the Summary sheet under the Ablation Modes test case.\n2	Turn on the output of the function generator. \n3	Collect the serial communications for each mode and level. \n3.1	Hit the Run button (big green arrow) in the EZView Software to start recording the serial communications. \n3.1.1	If the program asks to save a  previous session, click No\n3.2	Activate ablation on the finger switch or foot petal for at least 10 continuous seconds. \n3.3	Release the finger switch or foot petal\n3.4	Hit the Stop button (big red square) in the EZView software\n3.5	Go to File>Save Data as Text\n3.6	Navigate to proper folder and save the file with a unique and identifiable filename. \n4	Repeat Steps 1 through 3 for both wands and each mode and level listed in the table above.\n5	Quiescent Period\n5.1	Using the same setup as Steps 1-4 set up the waveform listed under the Quiescent Period test case on the function generator. \n5.2	Plug in a wand with the configuration file for the Flow 50 Wand. \n5.3	Set the generator to Low, -.\n5.4	Turn on the output of the function generator. \n5.5	Collect the serial communications for each wand, using the same input from the function generator. \n5.5.1	Hit the Run button (big green arrow) in the EZView Software to start recording the serial communications. \n5.5.2	If the program asks to save a  previous session, click No\n5.5.3	Activate ablation on the finger switch or foot petal for at least 2 continuous seconds. \n5.5.4	Release the finger switch or foot petal\n5.5.5	Hit the Stop button (big red square) in the EZView software\n5.5.6	Go to File>Save Data as Text\n5.5.7	Navigate to proper folder and save the file with a unique and identifiable filename. \n5.6	Repeat Steps 5.3 through 5.5 for Low, 0 and Low, +.\n5.7	Repeat Steps 5.1-5.6 with a wand that has the Flow 90 configuration file. \n6	Vac Mode Verification  Part 1: Voltage Verification\n6.1	Setting up the scope\n6.1.1	Connect the 10x voltage probe to TP 95 (Labeled Mod2) of the Main Board and Channel 1 of the oscilloscope. Connect the ground clip to the DGRN TP on the main board. \n6.1.2	Use the following settings for the Channel 1\n6.1.2.1	Channel 1: DC coupled, 1 M Impedance, 10 V/div, 10X Attenuation\n6.1.2.2	Time Scale: 1.00 s/div, Trigger @ 4.8 s, 1M or Greater Points\n6.1.2.3	Trigger: Rising Edge, Channel 1, Normal Mode, 10 V\n6.2	Connect the Function Generator to the RMS Current Test Point on the RF20000a Main Board \n6.2.1	Connect the BNC end of the BNC to alligator clip cable to the Function Generator\n6.2.2	Connect positive lead of the BNC to alligator clip cable to Test Point 98 (Labeled IRMS2)\n6.2.3	Connect negative lead of the BNC to alligator clip cable to Test Point 84 (Labeled DGRN)\n6.3	Set the output mode to High Z Mode. This procedure will vary depending on the function generator. For the Agilent 33220A Function generator the procedure is as follows:	\n6.3.1	Hit the Utility button \n6.3.2	Hit the3rd (from the left)  soft key under Output Setup on the screen\n6.3.3	Hit the 1st (from the left) soft key under Load/High Z until High Z is selected. \n6.3.4	Hit the 6th (from the left) soft key under Done\n6.4	Set the Function Generator to the wave listed under the Vac 1 test case on the Spreadsheet summary page. \n6.5	Plug in a wand (or wand substitute) that has the configuration file for the Flow 50 wand. \n6.6	Once the therapy screen has come up, press the Single Button on the Oscilloscope.\n6.7	Activate Vac mode for at least 10 seconds by using either the finger switches or the foot pedal.\n6.8	After the activation the Oscilloscope should look like the following figure: \n \n6.9	Hit the Cursors button to bring up the cursors.\n6.10	Add a mean value measurement between the cursors (The following instructions are for a Tektronix DPO 3014)\n6.10.1	Hit the Measure Button \n6.10.2	Hit soft key labeled Add Measurement\n6.10.3	Change the Measurement Type to Mean using the multipurpose knob A\n6.10.4	Change the Source to Channel 1 using the multipurpose knob B\n6.10.5	Hit OK ADD Measurement \n6.10.6	Hit the More soft key until Gating is Highlighted\n6.10.7	Hit the third soft key labeled Between Cursors to select the Gating type to be between the cursors \n6.11	Place Cursor A at the first step and cursor B at the second step as shown in the following figure and record the  time for cursors and the calculated mean voltage in the 50 deg wand spreadsheet under beside time and mean voltage for step 1.\n \n6.12	Place Cursor A at the second step and cursor B at the third step as shown in the following figure and record the  time for cursors and the calculated mean voltage in the 50 deg wand spreadsheet under beside time and mean voltage for step 2.\n \n6.13	Place Cursor A at the third step and cursor B at the fourth step as shown in the following figure and record the  time for cursors and the calculated mean voltage in the 50 deg wand spreadsheet under beside time and mean voltage for step 3.\n \n6.14	Repeat for the 90 deg wand. The measurement of the last step will be slightly different from that of the 50 deg wand. The following figure shows the measured signal and the cursor placement for the 3rd step. \n \n7	Vac Mode Verification  Part 2: Pump Speed Verification\n7.1	Set up the system according to Steps 7.4 (In Setup Section). \n7.2	Set the Function Generator to the wave listed under the Vac 2 test case on the Spreadsheet summary page. \n7.3	Turn on the output of the function generator. \n7.4	Collect the serial communications for each wand, using the same input from the function generator. \n7.4.1	Hit the Run button (big green arrow) in the EZView Software to start recording the serial communications. \n7.4.2	If the program asks to save a  previous session, click No\n7.4.3	Activate ablation on the finger switch or foot petal for at least 10 continuous seconds. \n7.4.4	Release the finger switch or foot petal\n7.4.5	Hit the Stop button (big red square) in the EZView software\n7.4.6	Go to File>Save Data as Text\n7.4.7	Navigate to proper folder and save the file with a unique and identifiable filename. \n7.5	Repeat Steps 7.2 through 7.4 for both wands. \n7.6	Set the Function Generator to the wave listed under the Vac 3 test case on the Spreadsheet summary page. \n7.7	Turn on the output of the function generator. \n7.8	Collect the serial communications for each wand, using the same input from the function generator. \n7.8.1	Hit the Run button (big green arrow) in the EZView Software to start recording the serial communications. \n7.8.2	If the program asks to save a  previous session, click No\n7.8.3	Activate ablation on the finger switch or foot petal for at least 10 continuous seconds. \n7.8.4	Release the finger switch or foot petal\n7.8.5	Hit the Stop button (big red square) in the EZView software\n7.8.6	Go to File>Save Data as Text\n7.8.7	Navigate to proper folder and save the file with a unique and identifiable filename. \n7.9	Repeat Steps 7.6 through 7.8 for both wands.','N/A',NULL),(4486,1183,1006,1,'Ensure the wand and